import Navbar from "./Navbar";
import { BrowserRouter as Router, Route } from "react-router-dom";

const App = () => {

  return(
      <Router>
          <div className="one">
          <Navbar />
          <div className = "ellipse">
          </div>
            <p className = "name"> hi, i'm nikki! </p>
          </div>

      </Router>
  );
}
export default App;
